function rand(top) {
  return Math.floor(Math.random() * top);
}

function drawRect(x, y, r, g, b, size) {
  context.fillStyle = "rgb(" + r + "," + g + "," + b + ")";
  //console.log(x, y);
  context.fillRect(x, y, size, size);
  //context.fillStyle(0, 0, 0);
}

